import React, { useEffect } from 'react'
import { useHistory } from 'react-router-dom'
import { setCookie } from '../../../untils/cookie'

const Pay = () => {
  const history = useHistory()
  useEffect(() => {
    const code = window.location.href
    setCookie('username', code, 365)
    history.goBack()
  }, [])
  return (
    <></>
  )
}

export default Pay
